import { useEffect } from "react";
// import { CLIENT_ID } from "./GetAccessToken";
// import { AUTH_SERVER_ADDRESS } from "./GetAccessToken";
import axios from 'axios';
// import { BEARER_HEADER_PREFIX } from "./Request";


export default function Logout(){
    const access_token = localStorage.getItem("access_token")

    useEffect(() => {
        // axios.get(`http://localhost:8090/realms/LibraryAppClient/protocol/openid-connect/logout`,
        // {
        //     headers: {Authorization: "Bearer " + access_token}
        // }
        // )
        fetch('http://localhost:8090/realms/LibraryAppClient/protocol/openid-connect/logout', {
          method: 'GET', // or 'POST' depending on your needs
          headers: {
            'Authorization': `Bearer ${access_token}`,
            'Content-Type': 'application/json',
            // Add other headers as needed
          },
        });
        // window.location.assign(`http://localhost:8090/realms/LibraryAppClient/protocol/openid-connect/logout`)
    }, []);

}
